import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import { Nav, Container, Card, Col } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import DropdownButton from 'react-bootstrap/DropdownButton';
import logo from '../assets/logo.png'

class NavHeader extends React.Component {
	state={
		selectedItem: '',
	}
	render() {

		return (
			<Navbar expand="lg" className="navbar-sticky">
				<Container
					fluid
					style={{fontFamily: 'Poppins', fontSize: '14px', color: '#585858',}}
				>
					<div className="navbar-wrapper">
						<Navbar.Brand
							style={{cursor: 'pointer', paddingLeft: 10}}
							onClick={() =>
								this.setState({ selectedItem: '' }, () => {
									this.props.history.push('/home');
								})
							}
						>
							<img width="155px" height="50px" src={logo} alt="" />
						</Navbar.Brand>
					</div>
					<Navbar.Collapse className="justify-content-start">
						<Nav>
							<Nav.Link
								// as={Link}
								// to="/savedMeeting"
								className={
									this.state.selectedItem == 'Meetings'
										? 'navlink_active'
										: 'navlink_inactive'
								}
								onClick={() => this.setState({ selectedItem: 'Meetings' })}
							>
								<span>mainTitle</span>
							</Nav.Link>

							<Nav.Link
								// as={Link}
								to="/upcommingMeeting"
								className={
									this.state.selectedItem == 'Upcoming meeting'
										? 'navlink_active'
										: 'navlink_inactive'
								}
								onClick={() => this.setState({ selectedItem: 'Upcoming meeting' })}
							>
								<span> schedule</span>
							</Nav.Link>

							<Nav.Link
								// as={Link}
								to="/contact"
								className={
									this.state.selectedItem == 'Contact'
										? 'navlink_active'
										: 'navlink_inactive'
								}
								onClick={() => this.setState({ selectedItem: 'Contact' })}
							>
								<span> contact</span>
							</Nav.Link>
						</Nav>
					</Navbar.Collapse>
					<Navbar.Collapse className="justify-content-end">
						<Nav>
							<div className="image-cropper">
									<img
										src="./../assets/pp.png"
										className={'py-1 px-1'}
									/>
								</div>

							{/*<DropdownButton> v*/}
								<Nav.Link
									// as={Link}
									onClick={() =>
										this.setState({ show: true, dropDownFlag: true })
									}
									style={{
										fontFamily: 'Poppins',
										fontSize: '14px',
										color: '#585858',
									}}
								>
									:)
									{/*<span><FontAwesomeIcon icon={faPowerOff} color={'#58585870'}/>&nbsp;</span><span>{intl.formatMessage({ id: 'logout.tooltip' })}</span>*/}
								</Nav.Link>
							{/*</DropdownButton>*/}
						</Nav>
					</Navbar.Collapse>
				</Container>
			</Navbar>
		);
	}
}

export default NavHeader;
